import React from 'react';
import Homepage from "./pages/Homepage";
import './App.css';
import Juicespage from "./pages/Juicespage";
import SingleJuicePage from "./pages/SingleJuicePage";
import SingleJuiceBody from "./components/SingleJuiceBody"
import { Router } from "@reach/router";

function App() {
  return (
    <div className="App">
        <Router>
          <Homepage path="/juice" default/>
          <Juicespage path="/juices" />
          <SingleJuiceBody path="/juices/:id"/>
        </Router>
    </div>
  );
}

export default App;
